  'collection' => '',
  'name' => 'tour.tour.language',
  'data' => 'a:10:{s:4:"uuid";s:36:"f1c14550-61f3-4a23-b0c1-99155e492d07";s:8:"langcode";s:2:"en";s:6:"status";b:1;s:12:"dependencies";a:1:{s:6:"module";a:1:{i:0;s:8:"language";}}s:5:"_core";a:1:{s:19:"default_config_hash";s:43:"K3KVksdkREnIdd2idoIA9TDHQew_WreFzTG-DHmz9Z4";}s:2:"id";s:8:"language";s:5:"label";s:8:"Language";s:6:"module";s:8:"language";s:6:"routes";a:1:{i:0;a:1:{s:10:"route_name";s:39:"entity.configurable_language.collection";}}s:4:"tips";a:6:{s:17:"language-overview";a:5:{s:2:"id";s:17:"language-overview";s:6:"plugin";s:4:"text";s:5:"label";s:9:"Languages";s:4:"body";s:96:"<p>The "Languages" page allows you to add, edit, delete, and reorder languages for the site.</p>";s:6:"weight";i:1;}s:12:"language-add";a:6:{s:2:"id";s:12:"language-add";s:6:"plugin";s:4:"text";s:5:"label";s:16:"Adding languages";s:4:"body";s:171:"<p>To add more languages to your site, click the "Add language" button.</p><p>Added languages will be displayed in the language list and can then be edited or deleted.</p>";s:6:"weight";i:2;s:10:"attributes";a:1:{s:10:"data-class";s:13:"button-action";}}s:16:"language-reorder";a:6:{s:2:"id";s:16:"language-reorder";s:6:"plugin";s:4:"text";s:5:"label";s:20:"Reordering languages";s:4:"body";s:402:"<p>To reorder the languages on your site, use the drag icons next to each language.</p><p>The order shown here is the display order for language lists on the site such as in the language switcher blocks provided by the Interface Translation and Content Translation modules.</p><p>When you are done with reordering the languages, click the "Save configuration" button for the changes to take effect.</p>";s:6:"weight";i:3;s:10:"attributes";a:1:{s:10:"data-class";s:9:"draggable";}}s:16:"language-default";a:6:{s:2:"id";s:16:"language-default";s:6:"plugin";s:4:"text";s:5:"label";s:25:"Set a language as default";s:4:"body";s:274:"<p>You can change the default language of the site by choosing one of your configured languages as default. The site will use the default language in situations where no choice is made but a language should be set, for example as the language of the displayed interface.</p>";s:6:"weight";i:4;s:10:"attributes";a:1:{s:10:"data-class";s:34:"js-form-item-site-default-language";}}s:19:"language-operations";a:6:{s:2:"id";s:19:"language-operations";s:6:"plugin";s:4:"text";s:5:"label";s:19:"Modifying languages";s:4:"body";s:399:"<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>";s:6:"weight";i:5;s:10:"attributes";a:1:{s:10:"data-class";s:18:"dropbutton-wrapper";}}s:17:"language-continue";a:5:{s:2:"id";s:17:"language-continue";s:6:"plugin";s:4:"text";s:5:"label";s:13:"Continuing on";s:4:"body";s:260:"<p>Now that you have an overview of the "Languages" page, you can continue by:<ul><li><a href="[site:url]admin/config/regional/language/add">Adding a language</a></li><li>Reordering languages</li><li>Editing a language</li><li>Deleting a language</li></ul></p>";s:6:"weight";i:6;}}}',
))
